import "./App.css";
import { Component } from "react";

class App extends Component {
  constructor() {
    super();
    this.state = {
      kediler: [],
    };
  }

  render() {
    return (
      <div className="App">
        <h1>{this.state.kediler.name}</h1>
      </div>
    );
  }

  componentDidMount() {
    fetch("https://api.jsonbin.io/b/5fffd67ff98f6e35d5fc4bc7")
      .then((response) => response.json)
      .then((users) => this.setState({ kediler: users }));
  }
}

export default App;
